import React from 'react'
import Item from './Item/Item'
import Products from '../../Containers/Products/Products'

const Items = (props) => {
  return (
    props.Data.map(Item => {
      return(
       <Item
        Name={Item.name}
        Description={Item.description}
        Price={Item.price}
        key={Item.id}
        Source={Item.source}
        />
      )


    })
  )
}

export default Items
